import './App.css';
import Card from './components/Card';


function App() {
  const apiKey = "https://api.data.gov.in/resource/93b75aee-8eed-4fd5-913f-8284ffe733e8?api-key=579b464db66ec23bdd0000014b84e48eb46245546655637612696e29%20&format=json&limit=10";
  return (
    <div className="container">
      <Card apiKey={apiKey} />
    </div>

  );
}

export default App;
